import React from "react";
import {
  Link,
  useLocation,
} from "react-router-dom";

export default class EntityView extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      error: null,
      isLoaded: false,
      entities: [],
    };
  }

  componentDidMount() {
    fetch("http://localhost/VSV/SAT/API/getEntity.php?id=1")
        .then((res) => res.json())
        .then(
            (result) => {
              this.setState({
                isLoaded: true,
                ...result,
              });
            },
            // Note: it's important to handle errors here
            // instead of a catch() block so that we don't swallow
            // exceptions from actual bugs in components.
            (error) => {
              this.setState({
                isLoaded: true,
                error: "Error loading entity",
              });
            }
        );
  }

  render() {
    return (
      <div>
         {/*Header Bar */}
        <div class="areas-header">
            <span class="header networkingDeviceList">
                <span>
                    <span>Title </span>
                    <span class="header-badge">Sub</span>
                </span>
            </span>
        </div>
         {/*Main Content*/}
        <div class="table-wrapper">

     {/*Side Detail */}
    <div class="class-detail side-detail">
      <h5>
        <span>Uptime</span>
        <a class="link" style="float: right;"
           data-bind="text: $root.deviceSelectedChartPeriod, click: $root.toggle_NetworkingDeviceSelectedChartPeriod">Hourly</a>
      </h5>
      <canvas id="uptimeChart" width="656" height="328"
    style="display: block; box-sizing: border-box; height: 164px; width: 328px;"/>

      <h5>Activity</h5>

      <div class="inbox-task" data-bind="css: {'recentFeed': IsRecent">
        <div class="forms">
          <div class="min_foto">
            <img class="dwimg" data-bind="attr:{src: '/ProfileImages/' + UserId}"
                 src="https://prabook.com/web/show-photo-icon.jpg?id=1918927&width=220&cache=true"/>
          </div>
          <h5>
            <span data-bind="text: UserId">Jeff Bezos</span>
          </h5>
          <h4>
            <span data-bind="text: Description">Updated Device Details</span>
          </h4>
          <h5>
            <span data-bind="text: FrienlyDate">1 hours ago</span>
          </h5>
        </div>
      </div>
    </div>

  </div>
      </div>
    );
  }
}
